import React from 'react'
import Layout from "../components/Layout";
import Input from '../components/Input'

function addPlace() {
  return (
    <Layout title="Add Place" subtitle="form to add a new place">
      <Input name='Title'  placeholder="Name of the place" icon='fa-landmark' validators={[]}/>
      <Input name='Description' type='textarea' placeholder="About the place" validators={[]}/>
      <Input name='Address'  placeholder="address" icon='fa-map-marked-alt' validators={[]}/>
    </Layout>
  )
}

export default addPlace
